import { useParams } from "react-router-dom"
import posts from 'json/posts.json'

const Post = () => {

    const params = useParams()

    const post = posts.find((post) => {
        return post.id === Number(params.id)
    })

    return(
        <h1>Post {params.id}</h1>
    )
}

export default Post
